analysis_extra:
{'longTextContent': '在家办公最大的问题还是网络的问题（呵呵21世纪了还陷在这种问题里你就说可悲不可悲），时有时无，飘忽不定的内网真的神烦！每天花在辛苦联网、不断重启、和Microsoft死磕这件事上的时间累计超过2小时了都！经常关键时刻断掉，再连上感觉都要明天了，暴脾气真的会被急哭！[顶][顶][顶]

办公时间界限真的很模糊，譬如这周末两天我居然都在办公？昨天还是到深夜那种？？？周末OT必须填起来了不然我对得起谁？？？[拜拜]

好想喝咖啡[泪][泪][泪]', 'url_objects': []}

digit_attr:
{'longTextContent': '微软GitHub在北极世界档案馆存储比特币代码：

据DailyHODL报道，微软(Microsoft)的GitHub档案程序为对比特币及其他开源项目进行末日防护，将这些项目通过代码形式存储在北极世界档案馆（Arctic World Archive ）中。比特币（BTC）项目在GitHub网站上拍摄了一张活动存储库的快照，并将代码存储在卤化银胶片上，以880万像素的帧进行编码。据悉，这种特殊的胶片设计寿命超过1000年。

