buttons:
{'longTextContent': 'Proprietary company是控股公司;
corp.是corporation的缩写，多指大型公司，企业集团。Microsoft Corp. 微软公司;
Inc.是incorporated的缩写，在美国更常用。Apple Inc. 苹果公司;
“Co., Ltd.”是“Company Limited”的缩写，Co.代表Company，Ltd.代表Limited。所有公司的总称。Tsingtao Brewery Co., Ltd.青岛啤酒股份有限公司;
“Co.”中的“.”是表示缩短省略的符号，不可省略。“Ltd.”也有一个“.”，也是不能省略的。其次，中间的逗号用来区分前后两个词，也是不能省略的。', 'url_objects': []}

itemid:
{'longTextContent': '部分Microsoft 365服务宕机 Windows 10激活受影响：

今天早些时候部分Microsoft 365服务、Xbox Live登录出现问题，部分用户无法登录Xbox One , 微软表示：我们正在调查影响多项Microsoft 365服务的问题报告并很快将提供更多的更新 , 微软表示：我们还正在解决与消费者服务有关的Microsoft服务帐户（MSA）登录问题，该问题似乎无关，不久将提供更多信息。

