{'longTextContent': '部分Microsoft 365服务宕机，Xbox/Windows 10激活受影响：

据外媒报道，今天早些时候部分Microsoft 365服务、Xbox Live登录出现问题，部分用户无法登录Xbox One。微软表示：“我们正在调查影响多项Microsoft 365服务的问题报告并很快将提供更多的更新。本次问题是由于最近的更新使得Microsoft 365企业和消费者服务出现网络问题。目前已经撤回了更新，并确认服务正在恢复。”（IT之家）

