{'longTextContent': '作为一个在windows电脑方面有着10年经验的业余玩家，以及对全球绝大部分安全杀毒软件有着还算不错的认知，竟然不知道什么时候被@金山毒霸 的#毒霸网址大全# 这一无耻的行为给击败了――劫持了我所有的浏览器主页（浏览器：Chrome、Firefox、Microsoft Edge 、Internet Explorer），并且无法重新设定。这是第一次碰到啊！！！还是苹果系统和Linux系统可靠。

经系统任务管理器排查检测才找到根目录，我相信普通的电脑小白除了重装系统之外应该是搞不定！，或者用@360安全卫士，@腾讯电脑管家 来对抗，不一定有用，没试过，也从来不用这些绑定软件。

